  return (
    <>
      <div>
        <h1>List of Users</h1>
        {users.map((user) => {
          return (
            <Card>
              <Users name={user.name} job={user.job} />
            </Card>
          );
        })}

        {/* <Users name="Melody" job="Developer" />
